::v-deep .addUser {
    height: 95vh;
    display: flex;
    flex-direction: column;
    border-radius: 8px;
    // .el-dialog__header {
    // }
    .el-dialog__body {
        flex: 1;
        padding: 5px 20px;
        display: flex;
        justify-content: space-between;
        .tree {
            width: 300px;
            height: 100%;
            .el-input {
                margin-bottom: 4px;
            }
            .el-tree {
                height: calc(100% - 45px);
                padding-top: 8px;
                overflow: auto;
            }
        }
        .center {
            flex: 1;
            margin: 0 1%;
            .conditions {
                .el-input {
                    width: 200px;
                }
            }
            .el-table::before {
                display: none;
            }
            .table {
                height: 90%;
                margin-top: 8px;
            }
        }
        .right {
            width: 32%;
            padding: 20px;
            border: 1px solid #e5e5e5;
            .el-tag {
                margin: 4px;
            }
        }
    }
    .el-dialog__footer {
        padding: 20px;
    }
}
